    padding: 20px;
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
`;


export const Products = ({cat,filters,sort}) => {
  console.log({cat,filters,sort});
  return (
    <Container>
        {popularProducts.map(item =>(
            <Product item={item} key={item.id} />
        ))}
    </Container>
  )
}
